const initState = {
    custom: 33
}
const initCustom = {
    id: 33,
    custom: 'Muhammad'
}

const customReduser = ( state = initCustom, action) =>{
    switch(action.type){
        case 'addCustom':
            return {...state, custom: state.custom + action.payload}
        case 'deleteCustom':
            return {...state, custom: state.custom.filter((item) => item.id !== action.payload)}
        default:
            return state;
    }
}

const cushReduser = (state = initState, action) =>{
    switch (action.type) {
        case 'ADD_NUMBER':
        return {...state, cash: state.cash + action.payload}
        case 'DELETE_NUMBER' : 
            return {...state, cash: state.cash + action.payload}

        default:
            return state;
    }
}

const initState2 = {
    customer: []
}

const customerReduser = (state = initState2, action) =>{
    switch (action.type) {
        case 'ADD_CUSTOMER':
        return {...state, customer: [...state.customer, action.payload]}
        case 'DELETE_CUSTOMERS' : 
            return {...state, customer: state.customer.filter((cust) => cust.id !== action.payload)}

        default:
            return state;
    }
}
export {
    customerReduser,
    cushReduser,
    customReduser,
}
